events.script:
main(){
  dpConnect(&quot;worker&quot;, DP + &quot;.CPU.INTF&quot;,
                      DP + &quot;.CPU.EXTF&quot;,
                      DP + &quot;.CPU.RUN&quot;,
                      DP + &quot;.CPU.STOP&quot;,
                      DP + &quot;.CPU.FRCE&quot;,
                      DP + &quot;.CPU.BAF&quot;,
                      DP + &quot;.CPU.BUS1F&quot;,
                      DP + &quot;.CPU.BUS2F&quot;,
                      DP + &quot;.CPU.REDF&quot;,
                      DP + &quot;.CPU.MSTR&quot;,
                      DP + &quot;.CPU.RACK0&quot;,
                      DP + &quot;.CPU.RACK1&quot;,
                      DP + &quot;.CPU.IFM1F&quot;,
                      DP + &quot;.CPU.IFM2F&quot;
                   // DP + &quot;.CPU.CRST&quot;,
                   // DP + &quot;.CPU.SF&quot;,
           );
}

void worker(dyn_string dp, dyn_bool val){
  for(int i=1; i&lt;=dynlen(dp); i++){
    string name_shape = dpSubStr(dp[i], DPSUB_DP_EL);
    dyn_string tmp = strsplit(name_shape, &quot;.&quot;);
    name_shape = tmp[dynlen(tmp)];
    if(val[i])
      setValue(name_shape, &quot;backCol&quot;, COLORS[name_shape]);
    else
      setValue(name_shape, &quot;backCol&quot;, &quot;White&quot;);
  }
}

// SimpleCtrlScriptStart {invalid}
main()
{
  EP_setBackColor();
}

void EP_setBackColor()
{
  dyn_errClass err;

  if( !dpExists( &quot;System1:1_0.INTF:_online.._value&quot;))
  {
    setValue(&quot;&quot;, &quot;color&quot;, &quot;_dpdoesnotexist&quot;);
    return;
  }

  dpConnect(&quot;EP_setBackColorCB&quot;,
            &quot;System1:1_0.INTF:_online.._value&quot;);
  err = getLastError();
  if (dynlen(err) &gt; 0)
    setValue(&quot;&quot;, &quot;color&quot;, &quot;_dpdoesnotexist&quot;);

}


void EP_setBackColorCB(string dpSource, int iNewValue)
{
  if (iNewValue == 1)
    setValue(&quot;&quot;, &quot;backCol&quot;, &quot;Yellow&quot;);
  else if (iNewValue == 3)
    setValue(&quot;&quot;, &quot;backCol&quot;, &quot;vorwKamGingUnq&quot;);
  else if (iNewValue == 5)
    setValue(&quot;&quot;, &quot;backCol&quot;, &quot;warningCamUna&quot;);
  else
    setValue(&quot;&quot;, &quot;backCol&quot;, &quot;AESbgAcknowledged&quot;);
}

